import React from 'react'
import { ReactDOM } from 'react'
import { red } from '@mui/material/colors'
import { ThemeProvider, createTheme } from '@mui/material/styles'


const theme = createTheme({
  palette: {
    light: {
      main: red[500],
    },
    dark:{
        main:'#121212',
    }
  },
})

export default theme
